import React from 'react'
import {ProductImg} from './style'



const Slider = () => {
    return (
      <Swiper
      spaceBetween={50}
      slidesPerView={3}
      onSlideChange={() => console.log('slide change')}
      onSwiper={(swiper) => console.log(swiper)}
    >
      <SwiperSlide><ProductImg src='/SLIDER_2500x.jpg' /></SwiperSlide>
      
    </Swiper>
    )
}

export default Slider
